import React from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';

// Pages
import RepairRequestForm from './pages/RepairRequestForm';
import DashboardCustomer from './pages/DashboardCustomer';
import DashboardTechnician from './pages/DashboardTechnician';
import DashboardManager from './pages/DashboardManager';
import FeedbackForm from './pages/FeedbackForm';

// Components
import Navbar from './components/Navbar';
import Footer from './components/Footer';

function App() {
  return (
    <Router>
      <div className="App" style={{ fontFamily: 'Arial, sans-serif', backgroundColor: '#F1F2F7', minHeight: '100vh' }}>
        <Navbar />

        <main style={{ padding: '2rem' }}>
          <Routes>
            <Route path="/" element={<Navigate to="/repair-request" />} />
            <Route path="/repair-request" element={<RepairRequestForm />} />
            <Route path="/customer-dashboard" element={<DashboardCustomer />} />
            <Route path="/technician-dashboard" element={<DashboardTechnician />} />
            <Route path="/manager-dashboard" element={<DashboardManager />} />
            <Route path="/feedback" element={<FeedbackForm />} />
          </Routes>
        </main>

        <Footer />
      </div>
    </Router>
  );
}

export default App;
